Title: John W. Burgess Special Collection Photo The reverse reads, in writing, &quot;&quot;Framed memento by John Burgess being presented to Elliot. See prior to his becoming an astronaut. EAFB / It was due to Elliot being killed in an aircraft accident. The (Neil) Armstong who was his backup man became the first man to walk on the moon. LR Back Virgil Weaver (mgr.), Elliot See (test pilot), Dick Scoks (chief test pilot), sitting: Mrs. See.&quot;&quot;
Additional Information: Presentation of framed momento to Elliot See. 
